import styled from "styled-components";

export const StyledNav = styled.nav`
  width: 100vw;
  background-color: black;
  color: white;


  ul {
    display: flex;
    flex-direction: row;
    justify-content: space-evenly;
    align-items: center;
    list-style-type: none;
  }
`
